Actionscript.script:
// _root.播放音效("闪现.wav"); // 为什么这里会播放闪现的音效？

if(_parent.技能浮空 == true)
{
   gotoAndPlay("龙斩跳前摇");
}

_parent.无敌 = false;
_parent.UpdateBigSmallState("技能结束","龙斩结束");

//_parent.动画完毕();
_root.技能路由.动画完毕(this,_parent);

onClipEvent(enterFrame){
   _parent.攻击时移动(0,6);
   _parent.攻击时可改变移动方向(1);
}

onClipEvent (load) {
	_parent._parent.skillShadow = this;
	if (!_root.是否阴影)
	{
		this._visible = false;
	}
	缩放乘数 = 3.611 * 175 / _parent._parent.身高;
	if (_parent._parent.技能浮空 == true)
	{
		if (_parent._parent.浮空)
		{
			this._y = 233.05 + (_parent._parent.起始Y - _parent._parent._y - _parent._parent.垂直速度) * 缩放乘数;
		}
	}
}
onClipEvent (enterFrame) {
	if (_root.是否阴影 && !_parent.落地)
	{
		this._y = 233.05 + (_parent._parent.起始Y - _parent._parent._y - _parent._parent.垂直速度) * 缩放乘数;
	}
	else
	{
		this._y = 233.05;
	}
}
